// src/App.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';

import HomePage from './pages/HomePage';
import ListingsPage from './pages/ListingsPage';
import ProfilePage from './pages/ProfilePage';
import PostJobPage from './pages/PostJobPage';
import PostServicePage from './pages/PostServicePage';

import { mockServices } from './data/mockServices';

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/listings" element={<ListingsPage services={mockServices} />} />
      <Route path="/profile/:id" element={<ProfilePage services={mockServices} />} />
      <Route path="/post-job" element={<PostJobPage />} />
      <Route path="/post-service" element={<PostServicePage />} />
    </Routes>
  );
};

export default App;
